import React, { Component } from 'react';
import './App.css';
import * as firebase from 'firebase';

class App extends Component {

  constructor() {
    super();
    this.state = {
      test: []
    };
  }

  componentDidMount() {
    const testRef = firebase.database().ref('/test');
    testRef.on('value', snap => {
      this.setState({
        test: snap.val()
      });
    });
  }

  render() {
    return (
      <div className="App">
        <h1>WellPower Orders</h1>
        <div className="order-list">
          {this.orders.map(entry =>(
            <orderEntry
              key={entry.Number}
              order={entry}
              assignDriver={this.assignDriver}
              onCancel={this.cancelOrder}
              onFinished={this.finishOrder}
              />
          ))}
        </div>
      </div>
    );
  } //end of render()
} //end of App()
export default App;
